            <NavLink className="navbar-offcanvas"
                style={{ color: "#f5efea" }} to='/home'>
            Home
            </NavLink>
              </Nav.Link>
              <Nav.Link>
            <NavLink className="navbar-offcanvas"
                style={{ color: "#f5efea" }} to='/about'>
             About
